import React, { useState } from 'react';

const Header = () => {
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);

  const toggleMobileMenu = () => {
    setMobileMenuOpen(!mobileMenuOpen);
  };

  const handleLogin = () => {
    alert('Login functionality would be implemented here');
  };

  return (
    <header style={styles.header}>
      <div style={styles.headerContent}>
        <div style={styles.logo}>
          <img 
            src="/logo.png" 
            alt="VIPLAV SINGH" 
            style={styles.logoImage}
          />
          <h1 style={styles.logoText}>VIPLAV SINGH</h1>
        </div>
        
        {/* Desktop Navigation */}
        <nav style={styles.navMenu}>
          <ul style={styles.navList}>
            <li style={styles.navItem}>
              <a href="#home" style={styles.navLink}>Home</a>
            </li>
            <li style={styles.navItem}>
              <a href="#newspaper" style={styles.navLink}>Newspaper Advertising</a>
            </li>
            <li style={styles.navItem}>
              <a href="#digital" style={styles.navLink}>Digital Marketing</a>
            </li>
            <li style={styles.navItem}>
              <a href="#radio" style={styles.navLink}>Radio Advertising</a>
            </li>
            <li style={styles.navItem}>
              <a href="#cinema" style={styles.navLink}>Cinema Advertising</a>
            </li>
          </ul>
        </nav>

        <div style={styles.headerRight}>
          <a href="#blog" style={styles.blogLink}>Blog</a>
          <button 
            onClick={handleLogin} 
            style={styles.loginButton}
          >
            Login
          </button>
          <button style={styles.contactButton}>
            Contact Us
          </button>
        </div>

        {/* Mobile Menu Button */}
        <button 
          onClick={toggleMobileMenu} 
          style={styles.mobileMenuButton}
        >
          {mobileMenuOpen ? '✕' : '☰'}
        </button>
      </div>

      {/* Mobile Menu */}
      {mobileMenuOpen && (
        <div style={styles.mobileMenu}>
          <div style={styles.mobileMenuContent}>
            <a href="#home" style={styles.mobileMenuLink}>Home</a>
            <a href="#newspaper" style={styles.mobileMenuLink}>Newspaper Advertising</a>
            <a href="#digital" style={styles.mobileMenuLink}>Digital Marketing</a>
            <a href="#radio" style={styles.mobileMenuLink}>Radio Advertising</a>
            <a href="#cinema" style={styles.mobileMenuLink}>Cinema Advertising</a>
            <a href="#blog" style={styles.mobileMenuLink}>Blog</a>
            <button 
              onClick={handleLogin} 
              style={styles.mobileLoginButton}
            >
              Login
            </button>
            <button style={styles.mobileContactButton}>
              Contact Us
            </button>
          </div>
        </div>
      )}
    </header>
  );
};

// All styles in one object
const styles = {
  header: {
    backgroundColor: '#fff',
    boxShadow: '0 2px 10px rgba(0, 0, 0, 0.1)',
