    backgroundColor: 'transparent',
    color: '#333',
    border: '1px solid #ddd',
    padding: '10px',
    borderRadius: '5px',
    cursor: 'pointer',
    fontWeight: '500',
    marginTop: '10px',
  },
  mobileContactButton: {
    backgroundColor: '#FF6B00',
    color: 'white',
    border: 'none',
    padding: '10px',
    borderRadius: '5px',
    cursor: 'pointer',
    fontWeight: '500',
    marginTop: '10px',
  },
  
  // Media queries
  '@media (max-width: 992px)': {
    navMenu: {
      display: 'none',
    },
    headerRight: {
      display: 'none',
    },
    mobileMenuButton: {
      display: 'block',
    },
    logoText: {
      fontSize: '18px', // Slightly smaller on mobile
    },
  },
};

export default Header;
